<p>    23 учасники тренінгу ознайомилися з сучасними підходами до виховання: сприяти самопізнанню, самореалізації, самоствердженню і самовдосконаленню особистості у контексті викликів часу; акцент зроблений на формуванні таких життєвих навичок, як спілкування, прийняття рішень, критичне мислення, управління емоціями, стресами та конфліктними ситуаціями, формування цінностей тощо.</p></p>
